import React from 'react';
import '../styles/HomePage.css';

const HomePage = () => {
    return(
        <div className="home">
            <h3>
                About
            </h3>
            
            <p>
                This app is meant to help build Hearthstone decks.  The arena builder takes data from the top decks and suggests options to best match the top decks for that class
            </p>
            <h3>
                Purpose
            </h3>
            <p>
                This app is made for demonstration and learning purposes of my skills.  I have no claim on Hearthstone or the property.
            </p>
        </div>
    );
};

export default HomePage;
